import Layout from "../layout/Layout";
import Hero from "../components/Hero";
import HomeServices from "../components/HomeServices";
import HomePortfolio from "../components/HomePortfolio";

const Home = () => (
  <Layout>
    <div>
      <Hero />
      <main>
          <HomeServices/>
          <HomePortfolio/>
      </main>
    </div>
  </Layout>
);

export default Home;
